import React from 'react';
import './moneyTable.scss';
import { Card } from 'antd';
import { Row, Col, Tabs } from 'antd';
import { Table } from 'antd';

const MoneyTable = () => {
    const columns = [
        {
          title: 'Name',
          dataIndex: 'name',
        },
        {
          title: 'Chinese Score',
          dataIndex: 'chinese',
          sorter: {
            compare: (a, b) => a.chinese - b.chinese,
            multiple: 3,
          },
        },
        {
          title: 'Math Score',
          dataIndex: 'math',
          sorter: {
            compare: (a, b) => a.math - b.math,
            multiple: 2,
          },
        },
        {
          title: 'English Score',
          dataIndex: 'english',
          sorter: {
            compare: (a, b) => a.english - b.english,
            multiple: 1,
          },
        },
      ];

      const data = [
        {
          key: '1',
          name: 'John Brown',
          chinese: 98,
          math: 60,
          english: 70,
        },
        {
          key: '2',
          name: 'Jim Green',
          chinese: 98,
          math: 66,
          english: 89,
        },
        {
          key: '3',
          name: 'Joe Black',
          chinese: 98,
          math: 90,
          english: 70,
        },
        {
          key: '4',
          name: 'Jim Red',
          chinese: 88,
          math: 99,
          english: 89,
        },
      ];

    return (
        <Card type="inner" title="전체 연봉">
            <Tabs defaultActiveKey="1" centered>
                <Tabs.TabPane tab="초봉" key="1">
                    <Row>
                        <Col span={24} offset={3}>

                        </Col>
                    </Row>                                    
                </Tabs.TabPane>
                <Tabs.TabPane tab="평균연봉" key="2">
                    Content of Tab Pane 2
                </Tabs.TabPane>
            </Tabs>
        </Card>
    );
};

export default MoneyTable;
